 /

<h2 style="margin: 0">13</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08875
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 suppresses tumor growth and metastasis in hepatocellular carcinoma by a dual blockade of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35968
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and MET . PURPOSE : MET signaling has been suggested a potential role in hepatocellular carcinoma ( HCC ) and associated with prometastasis during antiangiogenesis therapy . We investigated the potential association between MET expression and therapeutic response to sorafenib in patients with HCC . Antitumor effects of cabozantinib , a dual inhibitor of MET and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35968
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , were examined in cultured HCC cells as well as in vivo models . EXPERIMENTAL DESIGN : Total MET and phosphorylated MET ( p-MET ) were measured in 29 resected HCC specimens , and correlated with response to sorafenib as postoperative adjuvant therapy . In the second set of experiments using cultured HCC cells , and mouse xenograft and metastatic models , effects of cabozantinib were examined . RESULTS : High level of p-MET in resected HCC specimens was associated with resistance to adjuvant sorafenib therapy . In cultured HCC cells that expressed p-MET , cabozantinib inhibited the activity of MET and its downstream effectors , leading to P55008 - phase arrest . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08875
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 inhibited tumor growth in p-MET-positive and p-MET-negative HCC by decreasing angiogenesis , inhibiting proliferation , and promoting apoptosis , but it exhibited more profound efficacy in p-MET-positive HCC xenografts . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08875
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 blocked the hepatocyte growth factor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14210
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) - stimulated MET pathway and inhibited the migration and invasion of the HCC cells . Notably , cabozantinib reduced the number of metastatic lesions in the lung and liver in the experimental metastatic mouse model . CONCLUSIONS : Patients with HCC with high level of p-MET are associated with resistance to adjuvant sorafenib treatment . The dual blockade of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35968
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and MET by cabozantinib has significant antitumor activities in HCC , and the activation of MET in HCC may be a promising efficacy-predicting biomarker . Clin Cancer Res ; 20 ( 11 ) ; 2959-70 .  2014 AACR .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Cytoplasmic and nuclear estrogen binding capacity in the rat uterus during treatment with danazol and testosterone . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01406
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , testosterone and dihydrotestosterone ( DB02901 ) were tested as competitors for estrogen receptors on immature rat uterus cytosol . No competitive binding could be demonstrated for any of these steroids . After that , prepubertal Wistar rats were exposed to danazol , testosterone or propylene glycol ( control ) for 3 days or 17 days . After the appropriate exposure to medication , the animals were killed . Both danazol and testosterone appeared to be uterotropic after 3 days of treatment , although the increase in the uterine weight was significant only in the danazol-treated group ( p less than 0.05 ) . This effect was lost after 17 days of treatment . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P03372
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 binding assays were done on the cytosolic and nuclear fractions of the homogenized uterine tissue of each group . The estrogen binding capacity of cytosols was increased in both the danazol ( p less than 0.05 ) and the testosterone ( p less than 0.01 ) groups after 3 days of treatment . A parallel increase was found in the nuclear fraction of both groups . After 17 days of treatment , the comparison between the 3 groups showed no differences in the cytosolic or nuclear estrogen binding capacity . The information provided by this study suggests that some effects of danazol may be due to an androgenic action and that may be associated to increases in the free fraction of testosterone .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Cortagine infused into the medial prefrontal cortex attenuates predator-induced defensive behaviors and Fos protein production in selective nuclei of the amygdala in male CD1 mice .

 ( CRF ) plays an essential role in coordinating the autonomic , endocrine and behavioral responses to stressors . In this study , we investigated the role of CRF within the medial prefrontal cortex ( mPFC ) in modulating unconditioned defensive behaviors , by examining the effects of microinfusing cortagine a selective type - 1 CRF receptor ( CRF 1 ) agonist , or acidic-astressin a preferential CRF 1 antagonist , into the mPFC in male CD - 1 mice exposed to a live predator ( rat exposure test - - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) . Cortagine microinfusions significantly reduced several indices of defense , including avoidance and freezing , suggesting a specific role for CRF 1 within the infralimbic and prelimbic regions of the mPFC in modulating unconditioned behavioral responsivity to a predator . In contrast , microinfusions of acidic-astressin failed to alter defensive behaviors during predator exposure in the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 . Cortagine microinfusions also reduced Fos protein production in the medial , central and basomedial , but not basolateral subnuclei of the amygdala in mice exposed to the rat predatory threat stimulus . These results suggest that CRF 1 activation within the mPFC attenuates predator-induced unconditioned anxiety-like defensive behaviors , likely via inhibition of specific amygdalar nuclei . Furthermore , the present findings suggest that the mPFC represents a unique neural region whereby activation of CRF 1 produces behavioral effects that contrast with those elicited following systemic administration of CRF 1 agonists .</div>

 ) was assessed by enzyme-linked immunosorbent assay . Diagnostic performance of the panel of tested biomarkers was evaluated using ROCs and descriptive statistical values , eg sensitivity and specificity . RESULTS : Seven of the 8 urine biomarkers were increased in subjects with bladder cancer relative to those without bladder cancer . The 7 biomarkers were assessed in a new model , which had an AUROC of 0.88 ( 95 % CI 0.84- 0.93 ) , and 74 % sensitivity and 90 % specificity . In contrast , the sensitivity of voided urine cytology and the UroVysion  cytogenetic test in this cohort was 39 % and 54 % , respectively . Study limitations include analysis performed on banked urine samples and the lack of voided urine cytology and cytogenetic test data on controls . CONCLUSIONS : The study provides further evidence that the reported panel of diagnostic biomarkers can reliably achieve the noninvasive detection of bladder cancer with higher sensitivity than currently available urine based assays .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Managing the underlying cause of cystic fibrosis : a future role for potentiators and correctors . Cystic fibrosis ( CF ) , a severe genetic disease , is caused by mutations that alter the structure and function of

</mark>
 , a plasma membrane channel permeable to chloride and bicarbonate . Defective anion transport in CF irreversibly damages the lungs , pancreas , liver , and other organs . CF mutations cause loss of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13569

</mark>
 function in multiple ways . In particular , class 3 mutations such as p . Gly 551Asp strongly decrease the time spent by 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13569
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 in the open state ( gating defect ) . Instead , class 2 mutations impair the maturation of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13569
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 protein and its transport from the endoplasmic reticulum to the plasma membrane ( trafficking defect ) . The deletion of phenylalanine 508 ( p . Phe 508del ) , the most frequent mutation among CF patients ( 70-90 % ) , destabilizes the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 protein , thus causing both a trafficking and a gating defect . These two defects can be overcome with drug-like molecules generically called correctors and potentiators , respectively . The potentiator Kalydeco  ( also known as 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 or VX - 770 ) , developed by Vertex Pharmaceuticals , has been recently approved by the US FDA and the European Medicines Agency ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) for the treatment of CF patients carrying at least one 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 allele with the p . Gly 551Asp mutation ( 2-5 % of all patients ) . In contrast , the corrector VX - 809 , which significantly improves p . Phe 508del - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 trafficking in vitro , is still under study in clinical trials . Because of multiple defects caused by the p . Phe 508del mutation , it is probable that rescue of the mutant protein will require combined treatment with correctors having different mechanisms of action . This review evaluates the status of experimental and clinical research in pharmacotherapy for the CF basic defect .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Serum hepcidin levels and reticulocyte hemoglobin concentrations as indicators of the iron status of peritoneal dialysis patients . P8 1172 is the key mediator of renal anemia , and reliable measurement of serum hepcidin levels has been made possible by the ProteinChip system . We therefore investigated the iron status and serum hepcidin levels of peritoneal dialysis ( PD ) patients who had not received frequent doses of an erythrocytosis-stimulating agent (

<h2 style="margin: 0">51</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Stable expression of a neuronal dopaminergic progenitor phenotype in cell lines derived from human amniotic fluid cells . Cells from human amniotic fluid derived from the fetus are considered a source of multipotent cells . Their properties have not been fully exploited , partially because unlike other embryonic sources such as embryonic stem ( ES ) cells , cell lines from amniocentesis samples have not been generated . We have established and characterized the properties of eight individual cell lines . Flow cytometry using several cell surface markers showed that all cell lines generated consisted of homogeneous populations that lack HLAII antigenicity . Using a combination of immunocytochemistry , Western blotting , and RT-PCR , we found weak expression of Oct 4 and nestin and strong expression of tubulin-betaIII , P11137 , and tau . Specific markers for cholinergic , ( nor ) adrenergic , and GABAergic neurons or glia were weakly expressed or absent , whereas expression of factors implicated in early induction of dopaminergic neurons , TGF-beta 3 and beta-catenin were present . Further analysis showed strong expression of EN - 1 , c -

 , PTX 3 , and

 essential for induction and survival of midbrain dopaminergic neurons , TH ,

<div class="entities" style="line-height: 2.5; direction: ltr">Targeting MET and vascular endothelial growth factor receptor signaling in castration-resistant prostate cancer . Effective management of bone metastases in men with castration-resistant prostate cancer ( CRPC ) remains an important unmet medical need . MET and vascular endothelial growth factor receptor ( VEGFR ) are rational targets for intervention in CRPC . Clinical trials involving agents that inhibit one but not both pathways have reported modest activity and no improvement in overall survival . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08875

</mark>
 is an oral multitargeted tyrosine kinase inhibitor that inhibits both MET and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35968
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . A phase II randomized discontinuation study involving subjects with CRPC demonstrated that cabozantinib therapy is associated with improvement in bone scans , bone turnover markers , and pain response , but with significant adverse events leading to dose reduction and treatment discontinuation . Lower doses of cabozantinib retain high levels of activity with less toxicity . Ongoing phase III clinical trials will define the role of cabozantinib in CRPC . We summarize the rationale for targeting MET and VEGFR pathways in CRPC and the clinical data available to date .</div>
